import axios from "axios";
const headers = {
  "Content-Type": "application/json"
};
const urlBack = "http://localhost:4000";

export default API ={
    companies: function(str){
        const data= axios.post(
            urlBack+"/companies",
            {
                str
            },
            { 
               headers: headers
            }
        )
        console.log(data)
        return data
    }
};
